import React from "react";
import classes from "./Header.module.css";

const Header = () => {
  return (
    <nav>
      <div className={classes.button}>
        <button>
          <a href="/welcome">Welcome</a>
        </button>
        <button>
          <a href="/products">Products</a>
        </button>
      </div>
    </nav>
  );
};

export default Header;
